import React from "react";
import Products from "./products";

function showProduct(event) {
  return (
    <div>
      <h1>{event.name}</h1>
    </div>
  );
}

const HomeScreen = () => {
  return <div>{Products.map(showProduct)}</div>;
};

export default HomeScreen;
